import React from 'react';
import {
    Typography,
    Avatar,
    Grid,
    Box
} from "@material-ui/core";
import avatar from "../profile-pic.jpg"

const Header = () => {
    return (
        <Box>
            <Avatar src={avatar} alt="Picture Profile" />
        </Box>
    );
};

export default Header
